      "title": "Custom City Maps Prints",
      "announcement": "iLikeMaps provides rich and detailed map prints of the cities you love.\r\nChoose your city, your colors and your size and we&#39;ll print a custom map for you! \r\n\r\niLikeMaps is the lovechild of Olivier Gratton-Gagn\u00e9 and Andr\u00e9e-Anne Marsan, couple from Montr\u00e9al, Canada. We both love maps so much that we started creating our own. Olivier handles the map creation while Andr\u00e9e-Anne manage orders and marketing.\r\n\r\nWe also run the following specialty shops:\r\nhttps:\/\/www.etsy.com\/shop\/OMaps\r\nhttps:\/\/www.etsy.com\/shop\/MetroMaps\r\n\r\nDon&#39;t hesitate to get in touch with us. We&#39;re happy to help fellow map lovers!\r\n",
      "currency_code": "USD",
      "is_vacation": false,
      "vacation_message": "Welcome to iLikeMaps.\r\nWe&#39;ll be on vacation until April 14.\r\n\r\niLikeMaps provides rich and detailed map prints of the cities you love.\r\nChoose your city, your colors and your size and we&#39;ll print a custom map for you! \r\n\r\niLikeMaps is the lovechild of Olivier Gratton-Gagn\u00e9 and Andr\u00e9e-Anne Marsan, couple from Montr\u00e9al, Canada. We both love maps so much that we started creating our own. Olivier handles the map creation while Andr\u00e9e-Anne manage orders and marketing.\r\n\r\nWe also run the following specialty shops:\r\nhttps:\/\/www.etsy.com\/shop\/OMaps\r\nhttps:\/\/www.etsy.com\/shop\/MetroMaps\r\n\r\nDon&#39;t hesitate to get in touch with us. We&#39;re happy to help fellow map lovers!\r\nWant to find out more? Check out this shop&#39;s About page.",
      "sale_message": "Hi!\r\n\r\nThank you for your order! We&#39;re very excited to prepare it for you.\r\n\r\nIf you like, you can have a look at the most common questions about the \r\n\r\nHow long it takes to make the prints?\r\n------------------------\r\nIf the product is already available in the shop, we strive to print it in 2 business days after payment goes through. Since we\u2019re a small operation, it may happen that we lack some printing\/shipping material. We\u2019ll get in touch with you if it delays your order substantially.\r\n\r\n\r\nI need the print before a specific date. Is this doable?\r\n------------------------\r\nMost of the time, yes! Get in touch with us as soon as possible and tell us your needs. We can expedite the process, upgrade the shipping (at a fee), send digital files, etc.\r\n\r\n\r\nPrint packaging\r\n------------------------\r\nTo give the maximum protection to your print, we use two packaging techniques.\r\n\r\nSmall prints: foam board, plastic bag and envelope.\r\nFor letter-sized print (8.5x11 inch) and lower, we ship them in a clear plastic bag reinforced with a foam core backing board. We then place it in a 9x12 envelope.\r\n\r\nLarger prints: tubes\r\nPrints larger than letter are carefully rolled, protected in a long clear plastic bag and then put into a craft tube. Paper stuffing is added at both ends to prevent corner bending.\r\n\r\n\r\nShipping method and delays\r\n------------------------\r\nSmall prints: Canada Post regular letter mail\r\nSmall prints are sent with the same service as letter mail (postcard, invoices, etc.). This method is fast most of the time and doesn\u2019t come with tracking. USA and Canada can expect 4 to 10 business days delivery and other countries from 6 to 20 business days.\r\n\r\nPrints up to 20x28: Canada Post Small Packet \u2013 Air\r\nPrints larger than letter and up to 20x28 inches are sent via Small Packet \u2013 Air service. This method doesn\u2019t come with tracking. USA and Canada can expect 4 to 10 business days delivery and other countries from 6 to 20 business days.\r\n\r\nPrints larger than 20x28: case by case basis\r\nFor larger print, the shipping method will depend on the print size and destination country.\r\n\r\n\r\nUpgrade to express\/tracked\r\n------------------------\r\nAt any time prior to the shipment, you can ask us about an upgrade to a faster \/ tracked shipping option. We\u2019ll give you the price of the upgrade and arrange a transaction. The feature of the upgrade depends on the countries and the print size.\r\n\r\n\r\nMy print didn\u2019t arrive. What should I do?\r\n------------------------\r\nGet in touch with us. We want your full satisfaction and we\u2019ll make sure you\u2019ll receive the print in good condition.\r\n\r\nWe\u2019ll send you another print if you haven\u2019t received yours after 20 business days (Canada and USA) and 35 business days (International) \u2013 at zero cost for you.\r\n\r\n\r\nI received the print in bad shape. What should I do?\r\n------------------------\r\nWe make our best to protect the prints, but sometime shipping can damage them. In that case, send us a message with a photo of the damaged print and we\u2019ll send you a brand new one \u2013 at zero cost for you.\r\n\r\n\r\nThe print is fine but I don\u2019t like it. What should I do?\r\n------------------------\r\nContact us and we\u2019ll find a solution together. We\u2019ll exchange products, issue refunds, etc. We\u2019ll make sure you\u2019ll come out happy of the transaction.\r\n\r\n",
