    "description": "Love Charleston South Carolina? Then this Charleston map print is for you!    \r\n\r\nThis city map has a modern, abstract art design made from of lots of little blue shapes. Each shape is actually a city block or a piece of land - and these shapes combine like a puzzle or mosaic to form this Charleston print.\r\n\r\nYou can see other things that make Charleston special:\r\n* roads and streets\r\n* water bodies (like the Cooper River and Ashley River)\r\n\r\nSIZES\r\nChoose your size (print only, frame\/mat not included):\r\n* 8x10 inch\r\n* 11x14 inch\r\n* 12x16 inch\r\n\r\nPAPER\r\n* premium quality\r\n* archival - long-lasting, durable and acid-free\r\n* heavyweight, smooth, non-glare\r\n\r\nINKS\r\n* professional quality - UltraChrome\r\n* long-lasting, beautiful, rich colours\r\n\r\nHANGING IT ON YOUR WALL\r\n* standard frame sized prints - so you can easily find affordable frames at many stores\r\n* prints include a border of white space - to help make framing\/matting easy\r\n\r\nPlease note that print colours may vary slightly due to individual monitor settings and lighting conditions.\r\n\r\nAll images: copyright \u00a9 2014 Maps As Art. All rights reserved.\r\nAdditional credit: \u00a9 OpenStreetMap contributors - openstreetmap.org",
