      "policy_welcome": "Thank you for visiting my shop! I&#39;m always working on new designs, so check back soon or become a facebook fan to learn about the newest designs and discount codes: http:\/\/www.facebook.com\/SaltyLyon",
      "policy_payment": "All buyers in New York State will be charged between 7 and 8.75% for sales tax, depending on what county you live in.",
      "policy_shipping": "***I will be unable to ship any orders between 1\/9-1\/13.  But all orders will still ship within 3-5 business days!***\r\n\r\n&gt;Most items take around 5-8 business days to arrive in the US (processing + ship time).\r\n&gt;Let me know if you need it by a certain day!\r\n&gt;Shipping a gift directly to the recipient and want to add a brief note? Just let me know what it should say at checkout.\r\n\r\n*******************\r\n\r\nItems are carefully packaged and shipped from the Syracuse, New York area.\r\n\r\nIn the US Paper Prints are shipped USPS First Class and Woodblock-mounted Prints are shipped USPS Priority Mail.  Please allow 5-10 business days for your order to arrive.\r\n\r\nOutside the US orders are shipped USPS First Class International. Please allow 10-15 business days for your order to arrive. It can take up to three weeks for an international shipment to arrive, and in rare circumstances a package can get caught up in customs and take a bit longer.\r\n\r\n*Buyers outside the US are responsible for any additional fees that may be charged by customs\r\n\r\nIf you need expedited shipping in the US:\r\nPRIORITY SHIPPING:\r\nhttps:\/\/www.etsy.com\/listing\/166153195\/priority-shipping-upgrade?ref=shop_home_active\r\nEXPRESS SHIPPING:\r\nhttps:\/\/www.etsy.com\/listing\/166154845\/express-shipping-upgrade?ref=related-0",
