    "title": "Historic Charleston Map Wedding Invitations - Destination Wedding - Charleston Wedding - Travel Wedding",
    "description": "Custom travel wedding invitations featuring a sophisticated vintage Charleston map background from 1898 and a blue and grey color scheme. Perfect for your Charleston wedding! Optional printed back side maps also available (see second photo).\r\n\r\nProfessionally printed on an environmentally-friendly HP Indigo Digital Press using genuine Indigo inks for long-lasting high quality color. Your choice of 7 cover stock options:\r\n\r\n90# White Linen Cover\r\n95# Hemp Cover (100% recycled) (white)\r\n100# Linen Cream Cover\r\n110# Uncoated White Cover\r\n110# Pearl Cover (shimmer) (off-white)\r\n110# Champagne Cover (shimmer) (cream)\r\n150# Cotton Cover (100% tree-free) (off-white)\r\n100# Desert Sands (similar to Kraft)\r\n\r\nINVITATION SET INCLUDES:\r\nwedding invitation (7&quot; x 5&quot;) w\/ envelope\r\nresponse card (4.875&quot; x 3.5&quot;) w\/ envelope\r\n\r\nPRICING:\r\nCustom Sample set - $20\r\n25 sets - $145\r\n50 sets - $245\r\n75 sets - $365\r\n100 sets - $390\r\n125 sets - $475\r\n150 sets - $540\r\n175 sets - $615\r\n200 sets - $650\r\n225 sets - $730\r\n250 sets - $750\r\n275 sets - $825\r\n300 sets - $850\r\n\r\n\r\nENVELOPE ADDRESSING\r\nReturn (FROM) address printing: $0.25\/envelope\r\nGuest (TO) address printing: $0.75\/envelope\r\n(you will need to provide us with a spreadsheet)\r\n\r\nNot quite what you&#39;re looking for? Check out our other Art Deco & Nouveau designs here: https:\/\/www.etsy.com\/shop\/merrymint?section_id=11767509\r\n\r\nYou can view all of our current designs by visiting our homepage: https:\/\/www.etsy.com\/shop\/merrymint\r\n\r\nPRINTABLE DIY INVITATION OPTION:\r\nIf you would prefer to order this invitation set as a 5-piece printable as shown in the 2nd image on this listing, you can purchase this listing instead (just specify your design selection in the Note to Seller):\r\nhttps:\/\/www.etsy.com\/listing\/110510071\/digital-printable-wedding-diy-invitation\r\n\r\n--------------\r\n\r\nORDERING A CUSTOM SUITE:\r\nIf you need extra enclosure cards, we can provide you with a custom quote. Send us a convo with the number of sets you would like to order, the number of extra enclosure cards you will need, your cover stock preference, and any other details we should know and we will reply with a quote. Once the quote is approved and you are ready to order, we will create a custom listing in our shop for you to purchase.\r\n\r\nCUSTOMIZATION:\r\nWe can customize this suite in any color and change the wording if necessary!  Once your custom listing purchase is confirmed through paypal, we will provide you with digital proofs for approval. We will not print until you have approved these proofs.\r\n\r\nOTHER ITEMS:\r\nAdditional coordinating cards are available (Table Cards, Place Cards\/Escort, Hotel and\/or Reception, etc.) If you have another reasonable request, we will do our best to work with you. Please let us know how we can help!!\r\n\r\nRUSH ORDERS:\r\nOrders needed in four weeks or less will incur a 15% rush charge.",
