      "vacation_message": "** HOLIDAY NOTICE ** We will be closed from March 22nd - March 25th - reopening Wednesday, March 26th at 9:00 am EST.  In the meantime, you are welcome to visit our website: http:\/\/www.MerrymintDesigns.com ",
      "sale_message": "Thank you for your purchase and for supporting Merrymint Designs! We hope you will think of using us again in the future. Please don&#39;t hesitate to contact us if you have any questions\/suggestions about our products or custom jobs.\r\n\r\nAlso, if you are happy with the level of service we&#39;ve provided you and the quality of our products, we would truly appreciate it if you would take a few moments to provide feedback once your order is complete! You can either use the Etsy Feedback system or email your feedback to merrymintdesigns@gmail.com - thanks in advance!\r\n\r\nDon&#39;t forget to LIKE our Facebook page at:\r\nhttp:\/\/www.facebook.com\/merrymint\r\n\r\nCheryl & Sherie\r\n\r\nSHOP HOURS: \r\nMon. - Thurs. 9am-5pm EST (please allow extra time to reply after 5pm)",
      "digital_sale_message": "Thank you for your purchase and for supporting Merrymint Designs! We hope you will think of using us again in the future. Please don&#39;t hesitate to contact us if you have any questions\/suggestions about our products or custom jobs.\r\n\r\nAlso, if you are happy with the level of service we&#39;ve provided you and the quality of our products, we would truly appreciate it if you would take a few moments to provide feedback once your order is complete! You can either use the Etsy Feedback system or email your feedback to merrymintdesigns@gmail.com - thanks in advance!\r\n\r\nDon&#39;t forget to LIKE our Facebook page at:\r\nhttp:\/\/www.facebook.com\/merrymint\r\n\r\nCheryl & Sherie",
      "last_updated_tsz": 1422020469,
      "listing_active_count": 171,
      "login_name": "merrymint",
      "accepts_custom_requests": true,
      "policy_welcome": "Hello & thanks for visiting Merrymint Designs! Please see below for all of our current policies and please don&#39;t hesitate to contact us if you have any further questions.",
      "policy_payment": "In order to avoid delays on your order, we prefer that payment (through PayPal) is made up front for all purchases. We will send a reminder within 24 hours if payment has not been received. Please note that no materials will be purchased to complete your order until we have received full payment for purchased items.\r\n\r\nRUSH ORDERS: Orders requiring completion and delivery in three weeks or less will incur a 15% rush charge. Please let us know that your order is a RUSH order when you contact us.",
      "policy_shipping": "Samples will be mailed by USPS within a week after receiving payment.  Custom orders will be completed and shipped via USPS Priority Mail no later than 2-3 weeks after proof approval (please note that proofs will only be started once payment is received). Exact turnaround time on full wedding suite orders depends on quantity. You will receive communication from us throughout the above time period with status updates and any questions. If there is any concern about meeting a deadline, please don&#39;t hesitate to contact us before ordering.\r\n\r\nNOTE: We will ship to the address you have on file with Etsy (unless instructed otherwise), please double-check your Etsy address when purchasing.\r\n\r\nINTERNATIONAL: We are happy to ship internationally, however, please note that international shipments can take up to 3 weeks and are subject to VAT and import taxes\/fees, which are the responsibility of the buyer.  We cannot be held responsible for any additional fees incurred. All items will be marked appropriately as &#39;merchandise&#39; (not &#39;gifts&#39;) on the customs forms and the full amount of what you paid (not to include shipping) will be declared on the forms.",
      "policy_refunds": "Due to the nature of these products, we cannot accept returns\/exchanges of personalized and customized items. Proofs will be provided in advance, so please be sure to check for misspellings, punctuation and grammatical errors. While we do our best in ensure there are no errors on your designs, you are responsible for accurate proofing prior to giving us the go-ahead on printing.\r\n\r\nIf your item is damaged during shipping, or if there is an error that we are responsible for, please let us know asap and we will work with you to resolve the situation quickly!",
      "policy_additional": "Custom and large orders are welcome. Please feel free to contact us if you have any questions or unusual requests! \r\n \r\n**IMPORTANT NOTE** Color can vary from one computer monitor to the next. Printed color may not be the same as what you see on your monitor. When in doubt, please order a printed sample prior to paying for a full wedding suite.\r\n\r\nHOW TO ORDER CUSTOMIZED WEDDING INVITATIONS \r\n1. If you would like to preview the invitations in person, order a sample invitation set from our shop. These samples can be customized with your own wording & colors.\r\n \r\n2. Once you have received your sample and have decided to order, send us a convo with quantities, any color changes, complete wording & details, and info on any extra printed pieces you will need for your wedding.\r\n\r\n3. We will provide you with a custom quote for all of the items you have requested. Once approved, we will set up a reserved listing for you in our shop. \r\n \r\n3. After we receive your payment, we will start work on your personalized proofs. We will send you a convo with your digital proof(s) and make any necessary changes. If you need a hard copy proof, please let us know! \r\n \r\n4. Once you are satisfied with the digital proof and you have double-checked for any spelling errors, etc... contact us to let us know you are ready to have your designs printed. We&#39;ll get started right away and will be sure to keep you updated on the progress of your order. \r\n \r\n5. When we have completed your order, you will receive a final convo from us letting you know that your custom order has been shipped and when you should expect to receive it.\r\n\r\n6. Enjoy your custom designs! Please leave us some feedback and let us know how we did!  We&#39;ll be happy to leave you feedback as well. \r\n\r\nDO YOU CREATE ANY OTHER ITEMS - MENUS \/ PROGRAMS \/ SEATING & TABLE CARDS? \r\nIf you can dream it up, we can do it!  We have designed custom table cards, seating cards, menus, reception cards, programs, accommodation & direction cards ... even water bottle labels and gift tags.  If you want it, send us a convo and we&#39;ll find a way to help you get it!\r\n\r\nCAN I ORDER A PERSONALIZED HIGH-RESOLUTION DIGITAL FILE OF ONE OF YOUR DESIGNS AND PRINT THEM MYSELF?\r\nAt this time we do not sell digital files of our wedding invitation suites. You can contact us about the availability of our other designs. We try to maintain very affordable prices - you will likely find that letting us handle the printing for you will actually save you time and money and free you up to focus on all of the other details surrounding your wedding day or event!\r\n\r\nCOPYRIGHT  \r\nAll designs contained within this shop are the intellectual property of Sherie & Cheryl LaPrade and Merrymint Designs.  You are not permitted to use these designs (and\/or derivatives of these designs) or the Merrymint Designs logo in any way without our prior authorization.  Thank you for your compliance & understanding!",
      "policy_seller_info": "Cheryl & Sherie LaPrade\r\nSummerville, SC, USA\r\nmerrymintdesigns@gmail.com",
