    "description": "CHARLESTON MAP, Map of Charleston,  South Carolina Map, Charleston Print, 4 section Map of Charleston SC. Painted street map showing the major features of Charleston. The sections of this map are 18x24 inches, so they will fit into standard store frames.  Very Cool!!\r\n\r\n\r\n-Our Watercolor Maps are some of the most interesting maps available. Each design is based on an actual map and then recolored with digital watercolors. Once painted the maps are then &quot;oversketched&quot; by hand to bring out the various details of the terrain and cities. The finished result is a totally unique and different map that is ready to hang in your home or office.\r\n\r\n-We can do a custom map of ANY LOCATION in the world. The detail can be street level to the entire city. You choose the area and we will do the rest.\r\n\r\n\r\n-------------------------------------------------------------\r\n\r\n                                            -Watermarks are not on your finished prints!!\r\n\r\n-Our prints are printed by a Professional Printing Company... They are NOT printed on a home printer.  The quality of our prints are the finest available; they are Archival Quality Images. \r\n              \r\n -DETAILS OF OUR PRINTING PROCESS:\r\n             ** 99-year acid-free Epson archival papers\r\n             ** High color gamut produces vivid colors by using a 12 ink printing system\r\n             ** Epson Ultra-Chrome HDR pigment-based inks (museum quality prints)\r\n             ** 10mil (260 g\/m2) paper thickness (heavy weight photo papers)\r\n             ** Printed at 2880x1440dpi (ultra resolutions)\r\n\r\n--------------------------------------------------\r\n-Available sizes (inches): 54x48\r\n\r\n-Frames are not included.\r\n\r\n-We are located in Greenville, SC, but our prints ship from Rhode Island, USA.  We try to process our orders in 12-24 hours and often on the same day they are placed.  Printing to arrival at your mailbox is usually within 7 days... It is a bit longer for international orders of course.\r\n\r\n\r\n-If your print arrives damaged, we will replace it no charge.  If you are not satisfied with your print, you can get a full refund (minus the shipping charges to send it back to us) within 7 days. Our goal is to give you a quality product that you are proud to display in your home or office.\r\n\r\n\r\n                           **** We Do Custom Maps....Just email us with your Specific Needs. ****\r\n\r\n\r\n                              Please note that actual colors may vary slightly due to monitor settings.",
