      "announcement": "Watercolor Maps of the World, City Skylines, and custom maps for your home and office.  Our world maps and city street maps are unique and creative examples of map art.  Also visit WaterColorMaps2 on Etsy for historical and topo maps... and SplatterMaps for creative map designs. ",
