      "is_vacation": false,
      "vacation_message": null,
      "sale_message": "Thanks for your order! \r\n \r\nMost maps are processed in 4-7 days for none custom prints.For custom prints, we&#39;ll be in touch with you to get the details correct. Custom art work usually requires an email proof and your approval before printing and can increase the processing time by a week sometimes.\r\n\r\nREMBER:\r\nWe do not ship foamboards or framed works internationally due to the high costs of taxes,duties and shipping.\r\n\r\nWe charge a flat rate for most international orders, but some larger prints and very distant destinations MAY REQUIRE ADDITIONAL SHIPPING costs. If this is the case, we will email you  an invoice for the adjusted total.\r\n------------------------------------------------------------------\r\n Visit our other shops on Etsy.\r\n\r\nCustom Travel Maps\r\nhttps:\/\/www.etsy.com\/shop\/TheTravelMapStore\r\n\r\n&quot;REAL&quot; WORLD MAPS and PULL-DOWN MAPS\r\nhttps:\/\/www.etsy.com\/shop\/WaterColorMaps2\r\n\r\nBOTANICAL PRINTS\r\nhttps:\/\/www.etsy.com\/shop\/TheOldFern?ref=search_shop_redirect\r\n\r\nUNIQUE MAP ART\r\nhttps:\/\/www.etsy.com\/shop\/SplatterMaps\r\n\r\n-------------------------------------------------------------------------------------------------\r\nOther Information:\r\n\r\n\r\n***We can print ANY of our maps on a synthetic matte banner canvas on sizes up to 8x10ft (or bigger if needed).  Just email us for details.\r\n\r\n------------------------------------------------------------------------------------------------\r\n\r\n                                                  Thanks, Chris and Mary Ann",
